Shared persistent volumes are created using the same workflow as normal persistent volumes: by starting with a reserved resource and applying a CREATE operation, either via the framework scheduler API or the /create-volumes HTTP endpoint. To create a shared volume, set the shared field during volume creation. For example, suppose a framework subscribed to the "engineering" role receives a resource offer containing 2048MB of dynamically reserved disk: { "allocation_info": { "role": "engineering" }, "id" : <offer_id>, "framework_id" : <framework_id>, "slave_id" : <slave_id>, "hostname" : <hostname>, "resources" : [ { "allocation_info": { "role": "engineering" }, "name" : "disk", "type" : "SCALAR", "scalar" : { "value" : 2048 }, "role" : "engineering", "reservation" : { "principal" : <framework_principal> } } ]
} The framework can create a shared persistent volume using this disk resource via the following offer operation: { "type" : Offer::Operation::CREATE, "create": { "volumes" : [ { "allocation_info": { "role": "engineering" }, "name" : "disk", "type" : "SCALAR", "scalar" : { "value" : 2048 }, "role" : "engineering", "reservation" : { "principal" : <framework_principal> }, "disk": { "persistence": { "id" : <persistent_volume_id> }, "volume" : { "container_path" : <container_path>, "mode" : <mode> } }, "shared" : { } } ] }
} Note that the shared field has been set (to an empty JSON object), which indicates that the CREATE operation will create a shared volume.

