The interface for implementing custom QoS Controllers is defined below: class QoSController
{
public: // Initializes this QoS Controller. This method needs to be // called before any other member method is called. It registers // a callback in the QoS Controller. The callback allows the // QoS Controller to fetch the current resource usage for each // executor on agent. virtual Try<Nothing> initialize( const lambda::function<process::Future<ResourceUsage>()>& usage) = 0; // A QoS Controller informs the agent about corrections to carry // out, but returning futures to QoSCorrection objects. For more // information, please refer to mesos.proto. virtual process::Future<std::list<QoSCorrection>> corrections() = 0;
}; NOTE The QoS Controller must not block corrections(). Back the QoS Controller with its own libprocess actor instead. The QoS Controller informs the agent that particular corrective actions need to be made. Each corrective action contains information about executor or task and the type of action to perform. Mesos comes with a noop and a load qos controller. The noop controller does not provide any corrections, thus does not assure any quality of service for regular tasks. The load controller is ensuring the total system load doesn't exceed a configurable thresholds and as a result try to avoid the cpu congestion on the node. If the load is above the thresholds controller evicts all the revocable executors. These thresholds are configurable via two module parameters load_threshold_5min and load_threshold_15min. They represent standard unix load averages in the system. 1 minute system load is ignored, since for oversubscription use case it can be a misleading signal. message QoSCorrection { enum Type { KILL = 1; // Terminate an executor. } message Kill { optional FrameworkID framework_id = 1; optional ExecutorID executor_id = 2; } required Type type = 1; optional Kill kill = 2;
}

