Five new flags has been added to the agent: Flag Explanation --oversubscribed_resources_interval=VALUE The agent periodically updates the master with the current estimation
about the total amount of oversubscribed resources that are allocated and
available. The interval between updates is controlled by this flag. (default:
15secs) --qos_controller=VALUE The name of the QoS Controller to use for oversubscription. --qos_correction_interval_min=VALUE The agent polls and carries out QoS corrections from the QoS Controller
based on its observed performance of running tasks. The smallest interval
between these corrections is controlled by this flag. (default: 0ns) --resource_estimator=VALUE The name of the resource estimator to use for oversubscription. The fixed resource estimator is enabled as follows: --resource_estimator="org_apache_mesos_FixedResourceEstimator" --modules='{ "libraries": { "file": "/usr/local/lib64/libfixed_resource_estimator.so", "modules": { "name": "org_apache_mesos_FixedResourceEstimator", "parameters": { "key": "resources", "value": "cpus:14" } } }
}' In the example above, a fixed amount of 14 cpus will be offered as revocable resources. The load qos controller is enabled as follows: --qos_controller="org_apache_mesos_LoadQoSController" --qos_correction_interval_min="20secs" --modules='{ "libraries": { "file": "/usr/local/lib64/libload_qos_controller.so", "modules": { "name": "org_apache_mesos_LoadQoSController", "parameters": [ { "key": "load_threshold_5min", "value": "6" }, { "key": "load_threshold_15min", "value": "4" } ] } }
}' In the example above, when standard unix system load average for 5 minutes will be above 6, or for 15 minutes will be above 4 then agent will evict all the revocable executors. LoadQoSController will be effectively run every 20 seconds. To install a custom resource estimator and QoS controller, please refer to the modules documentation .

