Consider for example the following ACL: Only principal foo can register frameworks subscribed to the analytics role. All principals can register frameworks subscribing to any other roles (including the principal foo since permissive is the default behavior). { "register_frameworks": [ { "principals": { "values": ["foo"] }, "roles": { "values": ["analytics"] } }, { "principals": { "type": "NONE" }, "roles": { "values": ["analytics"] } } ]
} Principal foo can register frameworks subscribed to the analytics and ads roles and no other role. Any other principal (or framework without a principal) can register frameworks subscribed to any roles. { "register_frameworks": [ { "principals": { "values": ["foo"] }, "roles": { "values": ["analytics", "ads"] } }, { "principals": { "values": ["foo"] }, "roles": { "type": "NONE" } } ]
} Only principal foo and no one else can register frameworks subscribed to the analytics role. Any other principal (or framework without a principal) can register frameworks subscribed to any other roles. { "register_frameworks": [ { "principals": { "values": ["foo"] }, "roles": { "values": ["analytics"] } }, { "principals": { "type": "NONE" }, "roles": { "values": ["analytics"] } } ]
} Principal foo can register frameworks subscribed to the analytics role and no other roles. No other principal can register frameworks subscribed to any roles, including *. { "permissive": false, "register_frameworks": [ { "principals": { "values": ["foo"] }, "roles": { "values": ["analytics"] } } ]
} In the following example permissive is set to false; hence, principals can only run tasks as operating system users guest or bar, but not as any other user. { "permissive": false, "run_tasks": [ { "principals": { "type": "ANY" }, "users": { "values": ["guest", "bar"] } } ]
} Principals foo and bar can run tasks as the agent operating system user alice and no other user. No other principal can run tasks. { "permissive": false, "run_tasks": [ { "principals": { "values": ["foo", "bar"] }, "users": { "values": ["alice"] } } ]
} Principal foo can run tasks only as the agent operating system user guest and no other user. Any other principal (or framework without a principal) can run tasks as any user. { "run_tasks": [ { "principals": { "values": ["foo"] }, "users": { "values": ["guest"] } }, { "principals": { "values": ["foo"] }, "users": { "type": "NONE" } } ]
} No principal can run tasks as the agent operating system user root. Any principal (or framework without a principal) can run tasks as any other user. { "run_tasks": [ { "principals": { "type": "NONE" }, "users": { "values": ["root"] } } ]
} The order in which the rules are defined is important. In the following example, the ACLs effectively forbid anyone from tearing down frameworks even though the intention clearly is to allow only admin to shut them down: { "teardown_frameworks": [ { "principals": { "type": "NONE" }, "framework_principals": { "type": "ANY" } }, { "principals": { "type": "admin" }, "framework_principals": { "type": "ANY" } } ]
} The previous ACL can be fixed as follows: { "teardown_frameworks": [ { "principals": { "type": "admin" }, "framework_principals": { "type": "ANY" } }, { "principals": { "type": "NONE" }, "framework_principals": { "type": "ANY" } } ]
} The ops principal can teardown any framework using the /teardown HTTP endpoint. No other principal can teardown any frameworks. { "permissive": false, "teardown_frameworks": [ { "principals": { "values": ["ops"] }, "framework_principals": { "type": "ANY" } } ]
} The principal foo can reserve resources for any role, and no other principal can reserve resources. { "permissive": false, "reserve_resources": [ { "principals": { "values": ["foo"] }, "roles": { "type": "ANY" } } ]
} The principal foo cannot reserve resources, and any other principal (or framework without a principal) can reserve resources for any role. { "reserve_resources": [ { "principals": { "values": ["foo"] }, "roles": { "type": "NONE" } } ]
} The principal foo can reserve resources only for roles prod and dev, and no other principal (or framework without a principal) can reserve resources for any role. { "permissive": false, "reserve_resources": [ { "principals": { "values": ["foo"] }, "roles": { "values": ["prod", "dev"] } } ]
} The principal foo can unreserve resources reserved by itself and by the principal bar. The principal bar, however, can only unreserve its own resources. No other principal can unreserve resources. { "permissive": false, "unreserve_resources": [ { "principals": { "values": ["foo"] }, "reserver_principals": { "values": ["foo", "bar"] } }, { "principals": { "values": ["bar"] }, "reserver_principals": { "values": ["bar"] } } ]
} The principal foo can create persistent volumes for any role, and no other principal can create persistent volumes. { "permissive": false, "create_volumes": [ { "principals": { "values": ["foo"] }, "roles": { "type": "ANY" } } ]
} The principal foo cannot create persistent volumes for any role, and any other principal can create persistent volumes for any role. { "create_volumes": [ { "principals": { "values": ["foo"] }, "roles": { "type": "NONE" } } ]
} The principal foo can create persistent volumes only for roles prod and dev, and no other principal can create persistent volumes for any role. { "permissive": false, "create_volumes": [ { "principals": { "values": ["foo"] }, "roles": { "values": ["prod", "dev"] } } ]
} The principal foo can destroy volumes created by itself and by the principal bar. The principal bar, however, can only destroy its own volumes. No other principal can destroy volumes. { "permissive": false, "destroy_volumes": [ { "principals": { "values": ["foo"] }, "creator_principals": { "values": ["foo", "bar"] } }, { "principals": { "values": ["bar"] }, "creator_principals": { "values": ["bar"] } } ]
} The principal ops can query quota status for any role. The principal foo, however, can only query quota status for foo-role. No other principal can query quota status. { "permissive": false, "get_quotas": [ { "principals": { "values": ["ops"] }, "roles": { "type": "ANY" } }, { "principals": { "values": ["foo"] }, "roles": { "values": ["foo-role"] } } ]
} The principal ops can update quota information (set or remove) for any role. The principal foo, however, can only update quota for foo-role. No other principal can update quota. { "permissive": false, "update_quotas": [ { "principals": { "values": ["ops"] }, "roles": { "type": "ANY" } }, { "principals": { "values": ["foo"] }, "roles": { "values": ["foo-role"] } } ]
} The principal ops can reach all HTTP endpoints using the GET method. The principal foo, however, can only use the HTTP GET on the /logging/toggle and /monitor/statistics endpoints. No other principals can use GET on any endpoints. { "permissive": false, "get_endpoints": [ { "principals": { "values": ["ops"] }, "paths": { "type": "ANY" } }, { "principals": { "values": ["foo"] }, "paths": { "values": ["/logging/toggle", "/monitor/statistics"] } } ]
}

