In case you plan to implement your own authorizer module , the authorization interface consists of three parts: First, the authorization::Request protobuf message represents a request to be authorized. It follows the Subject-Verb-Object pattern, where a subject ---commonly a principal---attempts to perform an action on a given object . Second, the Future<bool> mesos::Authorizer::authorized(const mesos::authorization::Request& request) interface defines the entry point for authorizer modules (and the local authorizer). A call to authorized() returns a future that indicates the result of the (asynchronous) authorization operation. If the future is set to true, the request was authorized successfully; if it was set to false, the request was rejected. A failed future indicates that the request could not be processed at the moment and it can be retried later. The authorization::Request message is defined in authorizer.proto: message Request { optional Subject subject = 1; optional Action action = 2; optional Object object = 3;
} message Subject { optional string value = 1;
} message Object { optional string value = 1; optional FrameworkInfo framework_info = 2; optional Task task = 3; optional TaskInfo task_info = 4; optional ExecutorInfo executor_info = 5; optional MachineID machine_id = 11;
} Subject or Object are optional fiels; if they are not set they will only match an ACL with ANY or NONE in the corresponding location. This allows users to construct the following requests: Can everybody perform action A on object O ? , or Can principal Z execute action X on all objects? . Object has several optional fields of which, depending on the action, one or more fields must be set (e.g., the view_executors action expects the executor_info and framework_info to be set). The action field of the Request message is an enum. It is kept optional--- even though a valid action is necessary for every request---to allow for backwards compatibility when adding new fields (see MESOS-4997 for details). Third, the ObjectApprover interface. In order to support efficient authorization of large objects and multiple objects a user can request an ObjectApprover via Future<shared_ptr<const ObjectApprover>> getApprover(const authorization::Subject& subject, const authorization::Action& action). The resulting ObjectApprover provides Try<bool> approved(const ObjectApprover::Object& object) to synchronously check whether objects are authorized. The ObjectApprover::Object follows the structure of the Request::Object above. struct Object
{ const std::string* value; const FrameworkInfo* framework_info; const Task* task; const TaskInfo* task_info; const ExecutorInfo* executor_info; const MachineID* machine_id;
}; As the fields take pointer to each entity the ObjectApprover::Object does not require the entity to be copied. Authorizer must ensure that ObjectApprovers returned by getApprover(...) method are valid throughout their whole lifetime. This is relied upon by parts of Mesos code (Scheduler API, Operator API events and so on) that have a need to frequently authorize a limited number of long-lived authorization subjects. This code on the Mesos side, on its part, must ensure that it does not store ObjectApprover for authorization subjects that it no longer uses (i.e. that it does not leak ObjectApprovers). NOTE: As the ObjectApprover is run synchronously in a different actor process ObjectApprover.approved() call must not block!

