Secrets can be specified using the following protobuf message: message Secret { enum Type { UNKNOWN = 0; REFERENCE = 1; VALUE = 2; } message Reference { required string name = 1; optional string key = 2; } message Value { required bytes data = 1; } optional Type type = 1; optional Reference reference = 2; optional Value value = 3;
} Secrets can be of type reference or value (only one of reference and value must be set). A secret reference can be used by modules to refer to a secret stored in a secure back-end. The key field can be used to reference a single value within a secret containing arbitrary key-value pairs. For example, given a back-end secret store with a secret named "/my/secret" containing the following key-value pairs: { "username": "my-user", "password": "my-password
} The username could be referred to in a Secret by specifying "my/secret" for the name and "username" for the key. Secret also supports pass-by-value where the value of a secret can be directly passed in the message.

