Volume Protobuf The Volume protobuf message has been updated to support Docker volumes. message Volume { ... required string container_path = 1; message Source { enum Type { UNKNOWN = 0; DOCKER_VOLUME = 1; } message DockerVolume { optional string driver = 1; required string name = 2; optional Parameters driver_options = 3; } optional Type type = 1; optional DockerVolume docker_volume = 2; } optional Source source = 5;
} When requesting a Docker volume for a container, the framework developer needs to set Volume for the container, which includes mode, container_path and source. The source field specifies where the volume comes from. Framework developers need to specify the type, Docker volume driver, name and options. At present, only the DOCKER_VOLUME type is supported; we plan to add support for more types of volumes in the future. How to specify container_path: If you are launching a Mesos container without rootfs. If container_path is an absolute path, you need to make sure the absolute path exists on your host root file system as the container shares the host root file system; otherwise, the task will fail. For other cases like launching a Mesos container without rootfs and container_path is a relative path, or launching a task with rootfs and container_path is an absolute path, or launching a task with rootfs and container_path as a relative path, the isolator will help create the container_path as the mount point. The following table summarizes the above rules for container_path: Container with rootfs Container without rootfs Absolute container_path No need to exist Must exist Relative container_path No need to exist No need to exist Examples Launch a task with one Docker volume using the default command executor. TaskInfo { ... "command" : ..., "container" : { "volumes" : [ { "container_path" : "/mnt/volume", "mode" : "RW", "source" : { "type" : "DOCKER_VOLUME", "docker_volume" : { "driver" : "rexray", "name" : "myvolume" } } } ] }
} Launch a task with two Docker volumes using the default command executor. TaskInfo { ... "command" : ..., "container" : { "volumes" : [ { "container_path" : "volume1", "mode" : "RW", "source" : { "type" : "DOCKER_VOLUME", "docker_volume" : { "driver" : "rexray", "name" : "volume1" } } }, { "container_path" : "volume2", "mode" : "RW", "source" : { "type" : "DOCKER_VOLUME", "docker_volume" : { "driver" : "rexray", "name" : "volume2", "driver_options" : { "parameter" : [{ "key" : <key>, "value" : <value> }, { "key" : <key>, "value" : <value> }] } } } } ] }
} NOTE : The task launch will be failed if one container uses multiple Docker volumes with the same driver and name.

