There are currently two types of SANDBOX_PATH volume sources: SELF and PARENT . If you are using Mesos Containerizer , SANDBOX_PATH volumes are handled by the volume/sandbox_path isolator. To enable this isolator, append volume/sandbox_path to the --isolation flag when starting the agent. The Docker Containerizer only supports SELF type SANDBOX_PATH volumes currently. SELF Type This represents a path in the container's own sandbox. The path can point to either a directory or a file in the sandbox of the container. The following example shows a SANDBOX_PATH volume from the container's own sandbox that mount the subdirectory tmp in the sandbox to /tmp in the container root filesystem. This will be useful to cap the /tmp usage in the container (if disk isolator is used and --enforce_container_disk_quota is turned on). { "container_path": "/tmp", "mode": "RW", "source": { "type": "SANDBOX_PATH", "sandbox_path": { "type": "SELF", "path": "tmp" } }
} The ownership of the volume will be the same as that of the sandbox of the container. Note that container_path has to be an absolute path in this case. If container_path is relative, that means it's a volume from a subdirectory in the container sandbox to another subdirectory in the container sandbox. In that case, the user can just create a symlink, instead of using a volume. PARENT Type This represents a path in the sandbox of the parent container. The path can point to either a directory or a file in the sandbox of the parent container. See the nested container doc for more details about what a parent container is. The following example shows a SANDBOX_PATH volume from the sandbox of the parent container that mounts the subdirectory shared_volume in the sandbox of the parent container to subdirectory volume in the sandbox of the container. { "container_path": "volume", "mode": "RW", "source": { "type": "SANDBOX_PATH", "sandbox_path": { "type": "PARENT", "path": "shared_volume" } }
} The ownership of the volume will be the same as that of the sandbox of the parent container.

