} message Offer { ... message Operation { enum Type { ... LAUNCH_GROUP = 6; ... } ... message LaunchGroup { required ExecutorInfo executor = 1; required TaskGroupInfo task_group = 2; } ... optional LaunchGroup launch_group = 7; }
