package mesos.agent; message Call { enum Type { ... // Calls for managing nested containers underneath an executor's container. NESTED_CONTAINER_LAUNCH = 14; // See 'NestedContainerLaunch' below. NESTED_CONTAINER_WAIT = 15; // See 'NestedContainerWait' below. NESTED_CONTAINER_KILL = 16; // See 'NestedContainerKill' below. } // Launches a nested container within an executor's tree of containers. message LaunchNestedContainer { required ContainerID container_id = 1; optional CommandInfo command = 2; optional ContainerInfo container = 3; } // Waits for the nested container to terminate and receives the exit status. message WaitNestedContainer { required ContainerID container_id = 1; } // Kills the nested container. Currently only supports SIGKILL. message KillNestedContainer { required ContainerID container_id = 1; } optional Type type = 1; ... optional NestedContainerLaunch nested_container_launch = 6; optional NestedContainerWait nested_container_wait = 7; optional NestedContainerKill nested_container_kill = 8;
} message Response { enum Type { ... NESTED_CONTAINER_WAIT = 13; // See 'NestedContainerWait' below. } // Returns termination information about the nested container. message NestedContainerWait { optional int32 exit_status = 1; } optional Type type = 1; ... optional NestedContainerWait nested_container_wait = 14;
} By adding the new Agent API, any authorized entity, including the executor itself, its tasks, or the operator can use this API to launch/wait/kill nested containers. Multi-level nesting is supported by using this API. Technically, the nested level is up to 32 since it is limited by the maximum depth of pid namespace and user namespace from the Linux Kernel. The following is the workflow of how the new Agent API works: The executor sends a NESTED_CONTAINER_LAUNCH call to the agent. +---------------------+ | | | Container | | | +-------------+ | +-----------------+ | | | LAUNCH | | | | | | <------------+ | | Executor | | | | | | | | | Mesos Agent | | +-----------------+ | | | | | | | | | | | | | +-------------+ | | +---------------------+ Depending on the LaunchNestedContainer from the executor, the agent launches a nested container inside of the executor container by calling containerizer::launch(). +---------------------+ | | | Container | | | +-------------+ | +-----------------+ | | | LAUNCH | | | | | | <------------+ | | Executor | | | | | | | | | Mesos Agent | | +-----------------+ | | | | | | | | +---------+ | | | +------------> | |Nested | | +-------------+ | |Container| | | +---------+ | +---------------------+ The executor sends a NESTED_CONTAINER_WAIT call to the agent. +---------------------+ | | | Container | | | +-------------+ | +-----------------+ | | | WAIT | | | | | | <------------+ | | Executor | | | | | | | | | Mesos Agent | | +-----------------+ | | | | | | | | +---------+ | | | | |Nested | | +-------------+ | |Container| | | +---------+ | +---------------------+ Depending on the ContainerID, the agent calls containerizer::wait() to wait for the nested container to terminate or exit. Once the container terminates or exits, the agent returns the container exit status to the executor. +---------------------+ | | | Container | | | +-------------+ WAIT | +-----------------+ | | | <------------+ | | | | | | | | Executor | | | | +------------> | | | | | Mesos Agent | Exited with | +-----------------+ | | | status 0 | | | | | +--XX-XX--+ | | | | | XXX | | +-------------+ | | XXX | | | +--XX-XX--+ | +---------------------+

