Frameworks wanting to enable IP per container, need to provide NetworkInfo message in TaskInfo. Here are a few examples: A request for one address of unspecified protocol version using the default command executor TaskInfo { ... command: ..., container: ContainerInfo { network_infos: [ NetworkInfo { ip_addresses: [ IPAddress { protocol: None; ip_address: None; } ] groups: []; labels: None; } ] }
} A request for one IPv4 and one IPv6 address, in two groups using the default command executor TaskInfo { ... command: ..., container: ContainerInfo { network_infos: [ NetworkInfo { ip_addresses: [ IPAddress { protocol: IPv4; ip_address: None; }, IPAddress { protocol: IPv6; ip_address: None; } ] groups: ["dev", "test"]; labels: None; } ] }
} A request for two network interfaces, each with one IP address, each in a different network group using the default command executor TaskInfo { ... command: ..., container: ContainerInfo { network_infos: [ NetworkInfo { ip_addresses: [ IPAddress { protocol: None; ip_address: None; } ] groups: ["foo"]; labels: None; }, NetworkInfo { ip_addresses: [ IPAddress { protocol: None; ip_address: None; } ] groups: ["bar"]; labels: None; }, ] }
} A request for a specific IP address using a custom executor TaskInfo { ... executor: ExecutorInfo { ..., container: ContainerInfo { network_infos: [ NetworkInfo { ip_addresses: [ IPAddress { protocol: None; ip_address: "10.1.2.3"; } ] groups: []; labels: None; } ] } }
} A request for joining a specific network using the default command executor TaskInfo { ... command: ..., container: ContainerInfo { network_infos: [ NetworkInfo { name: "network1"; } ] }
} NOTE: The Mesos Containerizer will reject any CommandInfo that has a ContainerInfo. For this reason, when opting in to network isolation when using the Mesos Containerizer, set TaskInfo.ContainerInfo.NetworkInfo.

482.body:
The NetworkInfo message allows frameworks to request IP address(es) to be assigned at task launch time on the Mesos agent. After opting in to network isolation for a given executor's container in this way, frameworks will need to know what address(es) were ultimately assigned in order to perform health checks, or any other out-of-band communication. This is accomplished by adding a new field to the TaskStatus message. message ContainerStatus { repeated NetworkInfo network_infos;
} message TaskStatus { ... optional ContainerStatus container; ...
}; Further, the container IP addresses are also exposed via Master's state endpoint. The JSON output from Master's state endpoint contains a list of task statuses. If a task's container was started with it's own IP address, the assigned IP address will be exposed as part of the TASK_RUNNING status. NOTE: Since per-container address(es) are strictly opt-in from the framework, the framework may ignore the IP address(es) provided in StatusUpdate if it didn't set NetworkInfo in the first place.

