Sometimes, a framework or an operator may find that the size of an existing persistent volume may be too small (possibly due to increased usage). In Offer::Operation::Create , we created a persistent volume from 2048 MB of disk resources. Suppose we want to grow the size of the volume to 4096 MB, we first need resource offer(s) with at least 2048 MB of disk resources with the same reservation and disk information: { "id" : <offer_id>, "framework_id" : <framework_id>, "slave_id" : <slave_id>, "hostname" : <hostname>, "resources" : [ { "name" : "disk", "type" : "SCALAR", "scalar" : { "value" : 2048 }, "role" : <offer's allocation role>, "reservation" : { "principal" : <framework_principal> } }, { "name" : "disk", "type" : "SCALAR", "scalar" : { "value" : 2048 }, "role" : <offer's allocation role>, "reservation" : { "principal" : <framework_principal> }, "disk": { "persistence": { "id" : <persistent_volume_id> }, "volume" : { "container_path" : <container_path>, "mode" : <mode> } } } ]
} We can grow the persistent volume by sending an Offer::Operation message. Offer::Operation::GrowVolume has a volume field which specifies the persistent volume to grow, and an addition field which specifies the additional disk space resource. { "type" : Offer::Operation::GROW_VOLUME, "grow_volume" : { "volume" : { "name" : "disk", "type" : "SCALAR", "scalar" : { "value" : 2048 }, "role" : <offer's allocation role>, "reservation" : { "principal" : <framework_principal> }, "disk": { "persistence": { "id" : <persistent_volume_id> }, "volume" : { "container_path" : <container_path>, "mode" : <mode> } } }, "addition" : { "name" : "disk", "type" : "SCALAR", "scalar" : { "value" : 2048 }, "role" : <offer's allocation role>, "reservation" : { "principal" : <framework_principal> } } }
} If this request succeeds, the persistent volume will be grown to the new size, and all files and directories associated with the volume will not be touched. A subsequent resource offer will contain the grown volume: { "id" : <offer_id>, "framework_id" : <framework_id>, "slave_id" : <slave_id>, "hostname" : <hostname>, "resources" : [ { "name" : "disk", "type" : "SCALAR", "scalar" : { "value" : 4096 }, "role" : <offer's allocation role>, "reservation" : { "principal" : <framework_principal> }, "disk": { "persistence": { "id" : <persistent_volume_id> }, "volume" : { "container_path" : <container_path>, "mode" : <mode> } } } ]
}

