Similarly, a framework or an operator may find that the size of an existing persistent volume may be too large (possibly due to over provisioning), and want to free up unneeded disk space resources. In Offer::Operation::Create , we created a persistent volume from 2048 MB of disk resources. Suppose we want to shrink the size of the volume to 1024 MB, we first need a resource offer with the volume to shrink: { "id" : <offer_id>, "framework_id" : <framework_id>, "slave_id" : <slave_id>, "hostname" : <hostname>, "resources" : [ { "name" : "disk", "type" : "SCALAR", "scalar" : { "value" : 2048 }, "role" : <offer's allocation role>, "reservation" : { "principal" : <framework_principal> }, "disk": { "persistence": { "id" : <persistent_volume_id> }, "volume" : { "container_path" : <container_path>, "mode" : <mode> } } } ]
} We can shrink the persistent volume by sending an Offer::Operation message via the acceptOffers API. Offer::Operation::ShrinkVolume has a volume field which specifies the persistent volume to grow, and a subtract field which specifies the scalar value of disk space to subtract from the volume: { "type" : Offer::Operation::SHRINK_VOLUME, "shrink_volume" : { "volume" : { "name" : "disk", "type" : "SCALAR", "scalar" : { "value" : 2048 }, "role" : <offer's allocation role>, "reservation" : { "principal" : <framework_principal> }, "disk": { "persistence": { "id" : <persistent_volume_id> }, "volume" : { "container_path" : <container_path>, "mode" : <mode> } } }, "subtract" : { "value" : 1024 } }
} If this request succeeds, the persistent volume will be shrunk to the new size, and all files and directories associated with the volume will not be touched. A subsequent resource offer will contain the shrunk volume as well as freed up disk resources with the same reservation information: { "id" : <offer_id>, "framework_id" : <framework_id>, "slave_id" : <slave_id>, "hostname" : <hostname>, "resources" : [ { "name" : "disk", "type" : "SCALAR", "scalar" : { "value" : 1024 }, "role" : <offer's allocation role>, "reservation" : { "principal" : <framework_principal> } }, { "name" : "disk", "type" : "SCALAR", "scalar" : { "value" : 1024 }, "role" : <offer's allocation role>, "reservation" : { "principal" : <framework_principal> }, "disk": { "persistence": { "id" : <persistent_volume_id> }, "volume" : { "container_path" : <container_path>, "mode" : <mode> } } } ]
} Some restrictions about resizing a volume (applicable to both Offer::Operation::GrowVolume and Offer::Operation::ShrinkVolume ): Only persistent volumes created on an agent's local disk space with ROOT or PATH type can be resized; A persistent volume cannot be actively used by a task when being resized; A persistent volume cannot be shared when being resized; Volume resize operations cannot be included in an ACCEPT call with other operations which make use of the resized volume.

