To allow dynamic provisioning of disk resources, two new offer operations have been added to the scheduler API : CREATE_DISK and DESTROY_DISK. To learn how to use the offer operations, please refer to the ACCEPT Call in the v1 scheduler API, or acceptOffers method in the v0 scheduler API for more details. message Offer { message Operation { enum Type { UNKNOWN = 0; LAUNCH = 1; LAUNCH_GROUP = 6; RESERVE = 2; UNRESERVE = 3; CREATE = 4; DESTROY = 5; GROW_VOLUME = 11; SHRINK_VOLUME = 12; CREATE_DISK = 13; // New in 1.7. DESTROY_DISK = 14; // New in 1.7. } optional Type type = 1; }
} CREATE_DISK operation The offer operation CREATE_DISK takes a RAW disk resource (create_disk.source), and create a MOUNT or a BLOCK disk resource (create_disk.target_type) from the source. The source RAW disk resource can either be a storage pool (i.e., a RAW disk resource without an ID) or a pre-existing disk (i.e., a RAW disk resource with an ID). The quantity of the converted resource (either MOUNT or BLOCK disk resource) will be the same as the source RAW resource. message Offer { message Operation { message CreateDisk { required Resource source = 1; required Resource.DiskInfo.Source.Type target_type = 2; } optional CreateDisk create_disk = 15; }
} The created disk resource will have the disk id and metadata set accordingly to uniquely identify the volume reported by the CSI plugin. Note that CREATE_DISK is different than CREATE . CREATE creates a persistent volume which indicates that the data stored in the volume will be persisted until the framework explicitly destroys it. It must operate on a non-RAW disk resource (i.e., PATH, MOUNT or BLOCK). DESTROY_DISK operation The offer operation DESTROY_DISK destroys a MOUNT or a BLOCK disk resource (destroy_disk.source), which will result in a RAW disk resource. The quantity of the RAW disk resource will be the same as the specified source, unless it has an invalid profile (described later), in which case the DESTROY_DISK operation will completely remove the disk resource. message Offer { message Operation { message DestroyDisk { required Resource source = 1; } optional DestroyDisk destroy_disk = 16; }
} This operation is intended to be a reverse operation of CREATE_DISK. In other words, if the volume is created from a storage pool (i.e., a RAW disk resource without an ID), the result of the corresponding DESTROY_DISK should be a storage pool. And if the volume is created from a pre-existing disk (i.e., a RAW disk resource with an ID), the result of the corresponding DESTROY_DISK should be a pre-existing disk. Currently, Mesos infers the result based on the presence of an assigned profile in the disk resource. In other words, if the volume to be destroyed has a profile, the converted RAW disk resource will be a storage pool (i.e., RAW disk resource without an ID). Otherwise, the converted RAW disk resource will be a pre-existing disk (i.e., RAW disk resource with an ID). This leverages the fact that currently, each storage pool must have a profile, and pre-existing disks do not have profiles. Getting Operation Results It is important for the frameworks to get the results of the above offer operations so that they know if the dynamic disk provisioning is successful or not. Starting with Mesos 1.6.0 it is possible to opt-in to receive status updates related to operations that affect resources managed by a resource provider. In order to do so, the framework has to set the id field in the operation. Support for operations affecting the agent default resources is coming soon .

539.body:
In order to let cluster operators customize the mapping between profiles and storage system-specific parameters, Mesos provides a module interface called DiskProfileAdaptor. class DiskProfileAdaptor
{
public: struct ProfileInfo { csi::VolumeCapability capability; google::protobuf::Map<std::string, std::string> parameters; }; virtual Future<ProfileInfo> translate( const std::string& profile, const ResourceProviderInfo& resourceProviderInfo) = 0; virtual Future<hashset<std::string>> watch( const hashset<std::string>& knownProfiles, const ResourceProviderInfo& resourceProviderInfo) = 0;
}; The module interface has a translate method that takes a profile and returns the corresponding CSI volume capability (i.e., the capability field) and CSI volume creation parameters (i.e., the parameters field) for that profile. These two fields will be used to call the CSI CreateVolume interface during dynamic provisioning (i.e., CREATE_DISK), or CSI ControllerPublishVolume and NodePublishVolume when publishing (i.e., when a task using the disk resources is being launched on a Mesos agent). The watch method in the module interface allows Mesos to get notified about the changes on the profiles. It takes a list of known profiles and returns a future which will be set if the module detects changes to the known profiles (e.g., a new profile is added). Currently, all profiles are immutable, thus are safe to cache. Since ProfileInfo uses protobuf from the CSI spec directly, there is an implicit dependency between backward compatibility of the module interface and the CSI spec version. Since CSI doesn't provide a backward compatibility promise, modules have to be re-built against each release of Mesos.

540.body:
To demonstrate how to use the disk profile adaptor module, Mesos ships with a default disk profile adaptor, called UriDiskProfileAdaptor. This module polls the profile information (in JSON) from a configurable URI. Here are the module parameters that can be used to configure the module: uri: URI to a JSON object containing the profile mapping. The module supports both HTTP(s) and file URIs. The JSON object should consist of some top-level string keys corresponding to the disk profile name. Each value should contain a ResourceProviderSelector under resource_provider_selector or a CSIPluginTypeSelector under csi_plugin_type_selector to specify the set of resource providers this profile applies to, followed by a VolumeCapability under volume_capabilities and arbitrary key-value pairs under create_parameters. For example: { "profile_matrix": { "my-profile": { "csi_plugin_type_selector": { "plugin_type": "org.apache.mesos.csi.test" }, "volume_capabilities": { "mount": { "fs_type": "xfs" }, "access_mode": { "mode": "SINGLE_NODE_WRITER" } }, "create_parameters": { "type": "raid5", "stripes": "3", "stripesize": "64" } } }
} poll_interval: How long to wait between polling the specified uri. If the poll interval has elapsed since the last fetch, then the URI is re-fetched; otherwise, a cached ProfileInfo is returned. If not specified, the URI is only fetched once. max_random_wait: How long at most to wait between discovering a new set of profiles and notifying the callers of watch. The actual wait time is a uniform random value between 0 and this value. If the --uri points to a centralized location, it may be good to scale this number according to the number of resource providers in the cluster. [default: 0secs] To enable this module, please follow the modules documentation : add the following JSON to the --modules agent flag, and set agent flag --disk_profile_adaptor to org_apache_mesos_UriDiskProfileAdaptor. { "libraries": [ { "file": "/PATH/TO/liburi_disk_profile.so", "modules": [ { "name": "org_apache_mesos_UriDiskProfileAdaptor", "parameters": [ { "key": "uri", "value": "/PATH/TO/my_profile.json" }, { "key": "poll_interval", "value": "1secs" } ] } ] } ]
}

