Each SLRP configures itself according to its ResourceProviderInfo which is specified by the operator. message ResourceProviderInfo { required string type = 3; required string name = 4; repeated Resource.ReservationInfo default_reservations = 5; // Storage resource provider related information. message Storage { required CSIPluginInfo plugin = 1; } optional Storage storage = 6;
} type: The type of the resource provider. This uniquely identifies a resource provider implementation. For instance: "org.apache.mesos.rp.local.storage". The naming of the type field should follow the Java package naming convention to avoid conflicts on the type names. name: The name of the resource provider. There could be multiple instances of a type of resource provider. The name field is used to distinguish these instances. It should be a legal Java identifier to avoid conflicts on concatenation of type and name. default_reservations: If set, any new resources from this resource provider will be reserved by default. The first ReservationInfo may have type STATIC or DYNAMIC, but the rest must have DYNAMIC. One can create a new reservation on top of an existing one by pushing a new ReservationInfo to the back. The last ReservationInfo in this stack is the "current" reservation. The new reservation's role must be a child of the current one. storage: Storage resource provider specific information (see more details below). message CSIPluginInfo { required string type = 1; required string name = 2; repeated CSIPluginContainerInfo containers = 3;
} type: The type of the CSI plugin. This uniquely identifies a CSI plugin implementation. For instance: "org.apache.mesos.csi.test". The naming should follow the Java package naming convention to avoid conflicts on type names. name: The name of the CSI plugin. There could be multiple instances of the same type of CSI plugin. The name field is used to distinguish these instances. It should be a legal Java identifier to avoid conflicts on concatenation of type and name. containers: CSI plugin container configurations (see more details below). The CSI controller service will be served by the first that contains CONTROLLER_SERVICE, and the CSI node service will be served by the first that contains NODE_SERVICE. message CSIPluginContainerInfo { enum Service { UNKNOWN = 0; CONTROLLER_SERVICE = 1; NODE_SERVICE = 2; } repeated Service services = 1; optional CommandInfo command = 2; repeated Resource resources = 3; optional ContainerInfo container = 4;
} services: Whether the CSI plugin container provides the CSI controller service , the CSI node service or both. command: The command to launch the CSI plugin container. resources: The resources to be used for the CSI plugin container. container: The additional ContainerInfo about the CSI plugin container. Note that each CSI plugin will have all isolation mechanisms configured on the agent applied to it. Sample SLRP Configuration The following is a sample SLRP configuration that uses the test CSI plugin provided by Mesos that provides both CSI controller and node services, and sets the default reservation to "test-role". The test CSI plugin will be built if you configure Mesos with --enable-tests-install. { "type": "org.apache.mesos.rp.local.storage", "name": "test_slrp", "default_reservations": [ { "type": "DYNAMIC", "role": "test-role" } ], "storage": { "plugin": { "type": "org.apache.mesos.csi.test", "name": "test_plugin", "containers": [ { "services": [ "CONTROLLER_SERVICE", "NODE_SERVICE" ], "command": { "shell": true, "value": "./test-csi-plugin --available_capacity=2GB --work_dir=workdir", "uris": [ { "value": "/PATH/TO/test-csi-plugin", "executable": true } ] }, "resources": [ { "name": "cpus", "type": "SCALAR", "scalar": { "value": 0.1 } }, { "name": "mem", "type": "SCALAR", "scalar": { "value": 200.0 } } ] } ] } }
}

