Labels can be found in the FrameworkInfo, TaskInfo, DiscoveryInfo and TaskStatus messages; framework and module writers can use Labels to tag and pass unstructured information around Mesos. Labels are free-form key-value pairs supplied by the framework scheduler or label decorator hooks. Below is the protobuf definitions of labels: optional Labels labels = 11; /** * Collection of labels. */
message Labels { repeated Label labels = 1;
} /** * Key, value pair used to store free form user-data. */
message Label { required string key = 1; optional string value = 2;
} Labels are not interpreted by Mesos itself, but will be made available over master and slave state endpoints. Further more, the executor and scheduler can introspect labels on the TaskInfo and TaskStatus programmatically. Below is an example of how two label pairs ("environment": "prod" and "bananas": "apples") can be fetched from the master state endpoint. $ curl http://master/state.json
...
{ "executor_id": "default", "framework_id": "20150312-120017-16777343-5050-39028-0000", "id": "3", "labels": [ { "key": "environment", "value": "prod" }, { "key": "bananas", "value": "apples" } ], "name": "Task 3", "slave_id": "20150312-115625-16777343-5050-38751-S0", "state": "TASK_FINISHED", ...
},

582.body:
Frameworks can use the scheduler driver's reconcileTasks method to send a reconciliation request to the master: // Allows the framework to query the status for non-terminal tasks.
// This causes the master to send back the latest task status for
// each task in 'statuses', if possible. Tasks that are no longer
// known will result in a TASK_LOST update. If statuses is empty,
// then the master will send the latest status for each task
// currently known.
virtual Status reconcileTasks(const std::vector<TaskStatus>& statuses); Currently, the master will only examine two fields in TaskStatus: TaskID: This is required. SlaveID: Optional but recommended. This leads to faster reconciliation in the presence of agents that are transitioning between states. Mesos provides two forms of reconciliation: "Explicit" reconciliation: the scheduler sends a list of non-terminal task IDs and the master responds with the latest state for each task, if possible. "Implicit" reconciliation: the scheduler sends an empty list of tasks and the master responds with the latest state for all currently known non-terminal tasks. Reconciliation results are returned as task status updates (e.g., via the scheduler driver's statusUpdate callback). Status updates that result from reconciliation requests will their reason field set to REASON_RECONCILIATION. Note that most of the other fields in the returned TaskStatus message will not be set: for example, reconciliation cannot be used to retrieve the labels or data fields associated with a running task.

