Command checks are described by the CommandInfo protobuf wrapped in the CheckInfo.Command message; some fields are ignored though: CommandInfo.user and CommandInfo.uris. A command check specifies an arbitrary command that is used to check a particular condition of the task. The result of the check is the exit code of the command. NOTE: Docker executor does not currently support checks. For all other tasks, including Docker containers launched in the mesos containerizer , the command will be executed from the task's mount namespace. To specify a command check, set type to CheckInfo::COMMAND and populate CheckInfo.Command.CommandInfo, for example: TaskInfo task = [...]; CheckInfo check;
check.set_type(CheckInfo::COMMAND);
check.mutable_command()->mutable_command()->set_value( "ls /checkfile > /dev/null"); task.mutable_check()->CopyFrom(check);

608.body:
HTTP checks are described by the CheckInfo.Http protobuf with port and path fields. A GET request is sent to http://<host>:port/path using the curl command. Note that <host> is currently not configurable and is set automatically to 127.0.0.1 (see limitations ), hence the checked task must listen on the loopback interface along with any other routeable interface it might be listening on. Field port must specify an actual port the task is listening on, not a mapped one. The result of the check is the HTTP status code of the response. Built-in executors follow HTTP 3xx redirects; custom executors may employ a different strategy. If necessary, executors enter the task's network namespace prior to launching the curl command. NOTE: HTTPS checks are currently not supported. To specify an HTTP check, set type to CheckInfo::HTTP and populate CheckInfo.Http, for example: TaskInfo task = [...]; CheckInfo check;
check.set_type(CheckInfo::HTTP);
check.mutable_http()->set_port(8080);
check.mutable_http()->set_path("/health"); task.mutable_check()->CopyFrom(check);

609.body:
TCP checks are described by the CheckInfo.Tcp protobuf, which has a single port field, which must specify an actual port the task is listening on, not a mapped one. The task is probed using Mesos' mesos-tcp-connect command, which tries to establish a TCP connection to <host>:port. Note that <host> is currently not configurable and is set automatically to 127.0.0.1 (see limitations ), hence the checked task must listen on the loopback interface along with any other routeable interface it might be listening on. Field port must specify an actual port the task is listening on, not a mapped one. The result of the check is the boolean value indicating whether a TCP connection succeeded. If necessary, executors enter the task's network namespace prior to launching the mesos-tcp-connect command. To specify a TCP check, set type to CheckInfo::TCP and populate CheckInfo.Tcp, for example: TaskInfo task = [...]; CheckInfo check;
check.set_type(CheckInfo::TCP);
check.mutable_tcp()->set_port(8080); task.mutable_check()->CopyFrom(check);

610.body:
The CheckInfo protobuf contains common options which regulate how a check must be performed by an executor: delay_seconds is the amount of time to wait until starting checking the task. interval_seconds is the interval between check attempts. timeout_seconds is the amount of time to wait for the check to complete. After this timeout, the check attempt is aborted and empty check update, i.e., the absence of the check result, is reported. NOTE: Since each time a check is performed a helper command is launched (see limitations ), setting timeout_seconds to a small value, e.g., <5s, may lead to intermittent failures. NOTE: Launching a check is not a free operation. To avoid unpredictable spikes in agent's load, e.g., when most of the tasks run their checks simultaneously, avoid setting interval_seconds to zero. As an example, the code below specifies a task which is a Docker container with a simple HTTP server listening on port 8080 and an HTTP check that should be performed every 5 seconds starting from the task launch and response time under 1 second. TaskInfo task = createTask(...); // Use Netcat to emulate an HTTP server.
const string command = "nc -lk -p 8080 -e echo -e \"HTTP/1.1 200 OK\r\nContent-Length: 0\r\n\"";
task.mutable_command()->set_value(command) Image image;
image.set_type(Image::DOCKER);
image.mutable_docker()->set_name("alpine"); ContainerInfo* container = task.mutable_container();
container->set_type(ContainerInfo::MESOS);
container->mutable_mesos()->mutable_image()->CopyFrom(image); // Set `delay_seconds` here because it takes
// some time to launch Netcat to serve requests.
CheckInfo check;
check.set_type(CheckInfo::HTTP);
check.mutable_http()->set_port(8080);
check.set_delay_seconds(15);
check.set_interval_seconds(5);
check.set_timeout_seconds(1); task.mutable_check()->CopyFrom(check);

612.body:
Command health checks are described by the CommandInfo protobuf; some fields are ignored though: CommandInfo.user and CommandInfo.uris. A command health check specifies an arbitrary command that is used to validate the health of the task. The executor launches the command and inspects its exit status: 0 is treated as success, any other status as failure. NOTE: If a task is a Docker container launched by the docker executor, it will be wrapped in docker run. For all other tasks, including Docker containers launched in the mesos containerizer , the command will be executed from the task's mount namespace. To specify a command health check, set type to HealthCheck::COMMAND and populate CommandInfo, for example: TaskInfo task = [...]; HealthCheck healthCheck;
healthCheck.set_type(HealthCheck::COMMAND);
healthCheck.mutable_command()->set_value("ls /checkfile > /dev/null"); task.mutable_health_check()->CopyFrom(healthCheck);

613.body:
HTTP(S) health checks are described by the HealthCheck.HTTPCheckInfo protobuf with scheme, port, path, and statuses fields. A GET request is sent to scheme://<host>:port/path using the curl command. Note that <host> is currently not configurable and is set automatically to 127.0.0.1 (see limitations ), hence the health checked task must listen on the loopback interface along with any other routeable interface it might be listening on. The scheme field supports "http" and "https" values only. Field port must specify an actual port the task is listening on, not a mapped one. Built-in executors follow HTTP 3xx redirects and treat status codes between 200 and 399 as success; custom executors may employ a different strategy, e.g., leveraging the statuses field. NOTE: Setting HealthCheck.HTTPCheckInfo.statuses has no effect on the built-in executors. If necessary, executors enter the task's network namespace prior to launching the curl command. To specify an HTTP health check, set type to HealthCheck::HTTP and populate HTTPCheckInfo, for example: TaskInfo task = [...]; HealthCheck healthCheck;
healthCheck.set_type(HealthCheck::HTTP);
healthCheck.mutable_http()->set_port(8080);
healthCheck.mutable_http()->set_scheme("http");
healthCheck.mutable_http()->set_path("/health"); task.mutable_health_check()->CopyFrom(healthCheck);

614.body:
TCP health checks are described by the HealthCheck.TCPCheckInfo protobuf, which has a single port field, which must specify an actual port the task is listening on, not a mapped one. The task is probed using Mesos' mesos-tcp-connect command, which tries to establish a TCP connection to <host>:port. Note that <host> is currently not configurable and is set automatically to 127.0.0.1 (see limitations ), hence the health checked task must listen on the loopback interface along with any other routeable interface it might be listening on. Field port must specify an actual port the task is listening on, not a mapped one. The health check is considered successful if the connection can be established. If necessary, executors enter the task's network namespace prior to launching the mesos-tcp-connect command. To specify a TCP health check, set type to HealthCheck::TCP and populate TCPCheckInfo, for example: TaskInfo task = [...]; HealthCheck healthCheck;
healthCheck.set_type(HealthCheck::TCP);
healthCheck.mutable_tcp()->set_port(8080); task.mutable_health_check()->CopyFrom(healthCheck);

615.body:
The HealthCheck protobuf contains common options which regulate how a health check must be performed and interpreted by an executor: delay_seconds is the amount of time to wait until starting health checking the task. interval_seconds is the interval between health checks. timeout_seconds is the amount of time to wait for the health check to complete. After this timeout, the health check is aborted and treated as a failure. consecutive_failures is the number of consecutive failures until the task is killed by the executor. grace_period_seconds is the amount of time after the task is launched during which health check failures are ignored. Once a health check succeeds for the first time, the grace period does not apply anymore. Note that it includes delay_seconds, i.e., setting grace_period_seconds < delay_seconds has no effect. NOTE: Since each time a health check is performed a helper command is launched (see limitations ), setting timeout_seconds to a small value, e.g., <5s, may lead to intermittent failures. As an example, the code below specifies a task which is a Docker container with a simple HTTP server listening on port 8080 and an HTTP health check that should be performed every 5 seconds starting from the task launch and allows consecutive failures during the first 15 seconds and response time under 1 second. TaskInfo task = createTask(...); // Use Netcat to emulate an HTTP server.
const string command = "nc -lk -p 8080 -e echo -e \"HTTP/1.1 200 OK\r\nContent-Length: 0\r\n\"";
task.mutable_command()->set_value(command) Image image;
image.set_type(Image::DOCKER);
image.mutable_docker()->set_name("alpine"); ContainerInfo* container = task.mutable_container();
container->set_type(ContainerInfo::MESOS);
container->mutable_mesos()->mutable_image()->CopyFrom(image); // Set `grace_period_seconds` here because it takes
// some time to launch Netcat to serve requests.
HealthCheck healthCheck;
healthCheck.set_type(HealthCheck::HTTP);
healthCheck.mutable_http()->set_port(8080);
healthCheck.set_delay_seconds(0);
healthCheck.set_interval_seconds(5);
healthCheck.set_timeout_seconds(1);
healthCheck.set_grace_period_seconds(15); task.mutable_health_check()->CopyFrom(healthCheck);

623.body:
This is the first step in the communication process between the scheduler and the master. This is also to be considered as subscription to the "/scheduler" event stream. To subscribe with the master, the scheduler sends an HTTP POST with a SUBSCRIBE message including the required FrameworkInfo, the list of initially suppressed roles and the initial offer constraints. The initially suppressed roles, as well as roles for which offer constraints are specified, must be contained in the set of roles in FrameworkInfo. Note that Mesos 1.11.0 simply ignores constraints for invalid roles, but this might change in the future. Note that if "subscribe.framework_info.id" and "FrameworkID" are not set, the master considers the scheduler as a new one and subscribes it by assigning it a FrameworkID. The HTTP response is a stream in RecordIO format; the event stream begins with either a SUBSCRIBED event or an ERROR event (see details in Events section). The response also includes the Mesos-Stream-Id header, which is used by the master to uniquely identify the subscribed scheduler instance. This stream ID header should be included in all subsequent non-SUBSCRIBE calls sent over this subscription connection to the master. The value of Mesos-Stream-Id is guaranteed to be at most 128 bytes in length. SUBSCRIBE Request (JSON): POST /api/v1/scheduler HTTP/1.1 Host: masterhost:5050
Content-Type: application/json
Accept: application/json
Connection: close { "type" : "SUBSCRIBE", "subscribe"	: { "framework_info"	: { "user" : "foo", "name" : "Example HTTP Framework", "roles": ["test1", "test2"], "capabilities" : [{"type": "MULTI_ROLE"}] }, "suppressed_roles" : ["test2"], "offer_constraints" : { "role_constraints": { "test1": { "groups": [{ "attribute_constraints": [{ "selector": {"attribute_name": "foo"}, "predicate": {"exists": {}} }] }] } } } }
} SUBSCRIBE Response Event (JSON):
HTTP/1.1 200 OK Content-Type: application/json
Transfer-Encoding: chunked
Mesos-Stream-Id: 130ae4e3-6b13-4ef4-baa9-9f2e85c3e9af <event length>
{ "type" : "SUBSCRIBED", "subscribed"	: { "framework_id" : {"value":"12220-3440-12532-2345"}, "heartbeat_interval_seconds" : 15 }
}
<more events> Alternatively, if "subscribe.framework_info.id" and "FrameworkID" are set, the master considers this a request from an already subscribed scheduler reconnecting after a disconnection (e.g., due to master/scheduler failover or network disconnection) and responds with a SUBSCRIBED event. For further details, see the Disconnections section below. NOTE: In the old version of the API, (re-)registered callbacks also included MasterInfo, which contained information about the master the driver currently connected to. With the new API, since schedulers explicitly subscribe with the leading master (see details below in Master Detection section), it's not relevant anymore. NOTE: By providing a different FrameworkInfo and/or set of suppressed roles and/or offer constraints, a re-subscribing scheduler can change some of the fields of FrameworkInfo, the set of suppressed roles and/or offer constraints. Allowed changes and their effects are consistent with those that can be performed via UPDATE_FRAMEWORK call (see below). If subscription fails for whatever reason (e.g., invalid request), an HTTP 4xx response is returned with the error message as part of the body and the connection is closed. A scheduler can make additional HTTP requests to the "/scheduler" endpoint only after it has opened a persistent connection to it by sending a SUBSCRIBE request and received a SUBSCRIBED response. Calls made without subscription will result in "403 Forbidden" instead of a "202 Accepted" response. A scheduler might also receive a "400 Bad Request" response if the HTTP request is malformed (e.g., malformed HTTP headers). Note that the Mesos-Stream-Id header should never be included with a SUBSCRIBE call; the master will always provide a new unique stream ID for each subscription.

625.body:
Sent by the scheduler when it accepts offer(s) sent by the master. The ACCEPT request includes the type of operations (e.g., launch task, launch task group, reserve resources, create volumes) that the scheduler wants to perform on the offers. Note that until the scheduler replies (accepts or declines) to an offer, the offer's resources are considered allocated to the offer's role and to the framework. Also, any of the offer's resources not used in the ACCEPT call (e.g., to launch a task or task group) are considered declined and might be reoffered to other frameworks, meaning that they will not be reoffered to the scheduler for the amount of time defined by the filter. The same OfferID cannot be used in more than one ACCEPT call. These semantics might change when we add new features to Mesos (e.g., persistence, reservations, optimistic offers, resizeTask, etc.). The scheduler API uses Filters.refuse_seconds to specify the duration for which resources are considered declined. If filters is not set, then the default value defined in mesos.proto will be used. NOTE: Mesos will cap Filters.refuse_seconds at 31536000 seconds (365 days). The master will send task status updates in response to LAUNCH and LAUNCH_GROUP operations. For other types of operations, if an operation ID is specified, the master will send operation status updates in response. For more information on running workloads using this call, see the introduction to the LAUNCH_GROUP and LAUNCH operations . ACCEPT Request (JSON):
POST /api/v1/scheduler HTTP/1.1 Host: masterhost:5050
Content-Type: application/json
Mesos-Stream-Id: 130ae4e3-6b13-4ef4-baa9-9f2e85c3e9af { "framework_id": {"value": "12220-3440-12532-2345"}, "type": "ACCEPT", "accept": { "offer_ids": [ {"value": "12220-3440-12532-O12"} ], "operations": [ { "type": "LAUNCH", "launch": { "task_infos": [ { "name": "My Task", "task_id": {"value": "12220-3440-12532-my-task"}, "agent_id": {"value": "12220-3440-12532-S1233"}, "executor": { "command": { "shell": true, "value": "sleep 1000" }, "executor_id": {"value": "12214-23523-my-executor"} }, "resources": [ { "allocation_info": {"role": "engineering"}, "name": "cpus", "role": "*", "type": "SCALAR", "scalar": {"value": 1.0} }, { "allocation_info": {"role": "engineering"}, "name": "mem", "role": "*", "type": "SCALAR", "scalar": {"value": 128.0} } ], "limits": { "cpus": "Infinity", "mem": 512.0 } } ] } } ], "filters": {"refuse_seconds": 5.0} }
} ACCEPT Response:
HTTP/1.1 202 Accepted

626.body:
Sent by the scheduler to explicitly decline offer(s) received. Note that this is same as sending an ACCEPT call with no operations. DECLINE Request (JSON):
POST /api/v1/scheduler HTTP/1.1 Host: masterhost:5050
Content-Type: application/json
Mesos-Stream-Id: 130ae4e3-6b13-4ef4-baa9-9f2e85c3e9af { "framework_id"	: {"value" : "12220-3440-12532-2345"}, "type" : "DECLINE", "decline" : { "offer_ids"	: [ {"value" : "12220-3440-12532-O12"}, {"value" : "12220-3440-12532-O13"} ], "filters"	: {"refuse_seconds" : 5.0} }
} DECLINE Response:
HTTP/1.1 202 Accepted

627.body:
Sent by the scheduler to perform two actions: Place the scheduler's role(s) in a non-SUPPRESSed state in order to once again receive offers. No-op if the role is not suppressed. Clears all filters for its role(s) that were previously set via ACCEPT and DECLINE. If no role is specified, the operation will apply to all of the scheduler's subscribed roles. REVIVE Request (JSON):
POST /api/v1/scheduler HTTP/1.1 Host: masterhost:5050
Content-Type: application/json
Mesos-Stream-Id: 130ae4e3-6b13-4ef4-baa9-9f2e85c3e9af { "framework_id" : {"value" : "12220-3440-12532-2345"}, "type" : "REVIVE", "revive" : {"role": <one-of-the-subscribed-roles>}
} REVIVE Response:
HTTP/1.1 202 Accepted

628.body:
Sent by the scheduler to kill a specific task. If the scheduler has a custom executor, the kill is forwarded to the executor; it is up to the executor to kill the task and send a TASK_KILLED (or TASK_FAILED) update. If the task hasn't yet been delivered to the executor when Mesos master or agent receives the kill request, a TASK_KILLED is generated and the task launch is not forwarded to the executor. Note that if the task belongs to a task group, killing of one task results in all tasks in the task group being killed. Mesos releases the resources for a task once it receives a terminal update for the task. If the task is unknown to the master, a TASK_LOST will be generated. KILL Request (JSON):
POST /api/v1/scheduler HTTP/1.1 Host: masterhost:5050
Content-Type: application/json
Mesos-Stream-Id: 130ae4e3-6b13-4ef4-baa9-9f2e85c3e9af { "framework_id"	: {"value" : "12220-3440-12532-2345"}, "type" : "KILL", "kill" : { "task_id"	: {"value" : "12220-3440-12532-my-task"}, "agent_id"	: {"value" : "12220-3440-12532-S1233"} }
} KILL Response:
HTTP/1.1 202 Accepted

629.body:
Sent by the scheduler to shutdown a specific custom executor (NOTE: This is a new call that was not present in the old API). When an executor gets a shutdown event, it is expected to kill all its tasks (and send TASK_KILLED updates) and terminate. If an executor doesn't terminate within a certain timeout (configurable via the --executor_shutdown_grace_period agent flag), the agent will forcefully destroy the container (executor and its tasks) and transition its active tasks to TASK_LOST. SHUTDOWN Request (JSON):
POST /api/v1/scheduler HTTP/1.1 Host: masterhost:5050
Content-Type: application/json
Mesos-Stream-Id: 130ae4e3-6b13-4ef4-baa9-9f2e85c3e9af { "framework_id"	: {"value" : "12220-3440-12532-2345"}, "type" : "SHUTDOWN", "shutdown" : { "executor_id"	: {"value" : "123450-2340-1232-my-executor"}, "agent_id" : {"value" : "12220-3440-12532-S1233"} }
} SHUTDOWN Response:
HTTP/1.1 202 Accepted

630.body:
Sent by the scheduler to acknowledge a status update. Note that with the new API, schedulers are responsible for explicitly acknowledging the receipt of status updates that have status.uuid set. These status updates are retried until they are acknowledged by the scheduler. The scheduler must not acknowledge status updates that do not have status.uuid set, as they are not retried. The uuid field contains raw bytes encoded in Base64. ACKNOWLEDGE Request (JSON):
POST /api/v1/scheduler HTTP/1.1 Host: masterhost:5050
Content-Type: application/json
Mesos-Stream-Id: 130ae4e3-6b13-4ef4-baa9-9f2e85c3e9af { "framework_id"	: {"value" : "12220-3440-12532-2345"}, "type" : "ACKNOWLEDGE", "acknowledge" : { "agent_id"	: {"value" : "12220-3440-12532-S1233"}, "task_id"	: {"value" : "12220-3440-12532-my-task"}, "uuid" : "jhadf73jhakdlfha723adf" }
} ACKNOWLEDGE Response:
HTTP/1.1 202 Accepted

631.body:
Sent by the scheduler to acknowledge an operation status update. Schedulers are responsible for explicitly acknowledging the receipt of status updates that have status.uuid set. These status updates are retried until they are acknowledged by the scheduler. The scheduler must not acknowledge status updates that do not have status.uuid set, as they are not retried. The uuid field contains raw bytes encoded in Base64. ACKNOWLEDGE_OPERATION_STATUS Request (JSON):
POST /api/v1/scheduler HTTP/1.1 Host: masterhost:5050
Content-Type: application/json
Mesos-Stream-Id: 130ae4e3-6b13-4ef4-baa9-9f2e85c3e9af { "framework_id": { "value": "12220-3440-12532-2345" }, "type": "ACKNOWLEDGE_OPERATION_STATUS", "acknowledge_operation_status": { "agent_id": { "value": "12220-3440-12532-S1233" }, "resource_provider_id": { "value": "12220-3440-12532-rp" }, "uuid": "jhadf73jhakdlfha723adf", "operation_id": "73jhakdlfha723adf" }
} ACKNOWLEDGE_OPERATION_STATUS Response:
HTTP/1.1 202 Accepted

632.body:
Sent by the scheduler to query the status of non-terminal tasks. This causes the master to send back UPDATE events for each task in the list. Tasks that are no longer known to Mesos will result in TASK_LOST updates. If the list of tasks is empty, master will send UPDATE events for all currently known tasks of the framework. RECONCILE Request (JSON):
POST /api/v1/scheduler HTTP/1.1 Host: masterhost:5050
Content-Type: application/json
Mesos-Stream-Id: 130ae4e3-6b13-4ef4-baa9-9f2e85c3e9af { "framework_id"	: {"value" : "12220-3440-12532-2345"}, "type" : "RECONCILE", "reconcile" : { "tasks" : [ { "task_id" : {"value" : "312325"}, "agent_id" : {"value" : "123535"} } ] }
} RECONCILE Response:
HTTP/1.1 202 Accepted

634.body:
Sent by the scheduler to send arbitrary binary data to the executor. Mesos neither interprets this data nor makes any guarantees about the delivery of this message to the executor. data is raw bytes encoded in Base64. MESSAGE Request (JSON):
POST /api/v1/scheduler HTTP/1.1 Host: masterhost:5050
Content-Type: application/json
Mesos-Stream-Id: 130ae4e3-6b13-4ef4-baa9-9f2e85c3e9af { "framework_id"	: {"value" : "12220-3440-12532-2345"}, "type" : "MESSAGE", "message" : { "agent_id" : {"value" : "12220-3440-12532-S1233"}, "executor_id" : {"value" : "my-framework-executor"}, "data" : "adaf838jahd748jnaldf" }
} MESSAGE Response:
HTTP/1.1 202 Accepted

636.body:
Sent by the scheduler when it doesn't need offers for a given set of its roles. When Mesos master receives this request, it will stop sending offers for the given set of roles to the framework. As a special case, if roles are not specified, all subscribed roles of this framework are suppressed. Note that master continues to send offers to other subscribed roles of this framework that are not suppressed. Also, status updates about tasks, executors and agents are not affected by this call. If the scheduler wishes to receive offers for the suppressed roles again (e.g., it needs to schedule new workloads), it can send REVIVE call. SUPPRESS Request (JSON):
POST /api/v1/scheduler HTTP/1.1 Host: masterhost:5050
Content-Type: application/json
Mesos-Stream-Id: 130ae4e3-6b13-4ef4-baa9-9f2e85c3e9af { "framework_id" : {"value" : "12220-3440-12532-2345"}, "type" : "SUPPRESS", "suppress" : {"roles": <an-array-of-strings>}
} SUPPRESS Response:
HTTP/1.1 202 Accepted

637.body:
Sent by the scheduler to change fields of its FrameworkInfo and/or the set of suppressed roles and/or offer constraints. Allowed changes and their effects are consistent with changing the same fields via re-subscribing. Disallowed updates Updating the following FrameworkInfo fields is not allowed: principal (mainly because "changing a principal" effectively means a transfer of a framework by an original principal to the new one; secure mechanism for such transfer is yet to be developed) user checkpoint UPDATE_FRAMEWORK call trying to update any of these fields is not valid, unlike an attempt to change user/checkpoint when resubscribing, in which case the new value is ignored. Updating framework roles Updating framework_info.roles and suppressed_roles is supported. In a valid UPDATE_FRAMEWORK call, new suppressed roles must be a (potentially empty) subset of new framework roles. Updating roles has the following effects: After the call is processed, master will be sending offers to all non-suppressed roles of the framework. Offers to old framework roles removed by this call will be rescinded. Offers to roles from suppressed set will NOT be rescinded. For roles that were transitioned out of suppressed, offer filters (set by ACCEPT/DECLINE) will be cleared. will be cleared. Other framework objects that use roles removed by this call (for example, tasks) are not affected. Updating offer constraints For the UPDATE_FRAMEWORK call to be successfull, the offer_constraints field, if present, must be internally valid (for the constraints validity criteria, please refer to comments in scheduler.proto ) As of 1.11.0, Mesos ignores offer constraints for roles other than valid roles in framework_info.roles; future versions of Mesos are going to treat such offer constraints as invalid. Updated offer constraints have an immediate effect on offer generation after update, but have no effect on already outstanding offers. Frameworks should not expect that offers they receive right after the UPDATE_FRAMEWORK call will satisfy the new constraints. Updating other fields Updating name, hostname, webui_url and labels is fully supported by Mesos; these updates are simply propagated to Mesos API endpoints. Updating failover_timeout and offer_filters is supported. Note that there is no way to guarantee that offers issued when the old offer_filters were in place will not be received by the framework after the master applies the update. Schedulers can add capabilities via updating capabilities field. The call attempting to remove a capability is not considered invalid; however, there is no guarantee that it is safe for the framework to remove the capability. If you really need your framewok to be able to remove a capability, please reach out to the Mesos dev/user list (dev@mesos.apache.org or user@mesos.apache.org). In future, to prevent accidental unsafe downgrade of frameworks, Mesos will need to implement minimum capabilities for schedulers (similarly to minimum master/agent capabilities, see MESOS-8878 ). UPDATE_FRAMEWORK Request (JSON): POST /api/v1/scheduler HTTP/1.1 Host: masterhost:5050
Content-Type: application/json
Accept: application/json
Connection: close { "type" : "UPDATE_FRAMEWORK", "update_framework"	: { "framework_info"	: { "user" : "foo", "name" : "Example HTTP Framework", "roles": ["test1", "test2"], "capabilities" : [{"type": "MULTI_ROLE"}] }, "suppressed_roles" : ["test2"] "offer_constraints" : { "role_constraints": { "test1": { "groups": [{ "attribute_constraints": [{ "selector": {"attribute_name": "foo"}, "predicate": {"exists": {}} }] }] } } } }
} UPDATE_FRAMEWORK Response:
HTTP/1.1 200 OK Response codes: "200 OK" after the update has been successfully applied by the master and sent to the agents. "400 Bad request" if the call was not valid or authorizing the call failed. "403 Forbidden" if the principal was declined authorization to use the provided FrameworkInfo. (Typical authorizer implementations will check authorization to use specified roles.) No partial updates occur in error cases: either all fields are updated or none of them. NOTE: In Mesos 1.9, effects of changing roles or suppressed roles set via UPDATE_FRAMEWORK could be potentially reordered with related effects of ACCEPT/DECLINE/SUPPRESS/REVIVE or another UPDATE_FRAMEWORK; to avoid such reordering, it was necessary to wait for UPDATE_FRAMEWORK response before issuing the next call. This issue has been fixed in Mesos 1.10.0 (see MESOS-10056 ).

640.body:
Sent by the master whenever there are new resources that can be offered to the framework. Each offer corresponds to a set of resources on an agent and is allocated to one of roles the framework is subscribed to. Until the scheduler 'Accept's or 'Decline's an offer the resources are considered allocated to the scheduler, unless the offer is otherwise rescinded, e.g., due to a lost agent or --offer_timeout. OFFERS Event (JSON) <event-length>
{ "type"	: "OFFERS", "offers"	: [ { "allocation_info": { "role": "engineering" }, "id" : {"value": "12214-23523-O235235"}, "framework_id" : {"value": "12124-235325-32425"}, "agent_id" : {"value": "12325-23523-S23523"}, "hostname" : "agent.host", "resources" : [ { "allocation_info": { "role": "engineering" }, "name" : "cpus", "type" : "SCALAR", "scalar" : {"value" : 2}, "role" : "*" } ], "attributes" : [ { "name" : "os", "type" : "TEXT", "text" : {"value" : "ubuntu16.04"} } ], "executor_ids" : [ {"value" : "12214-23523-my-executor"} ] } ]
}

641.body:
Sent by the master when a particular offer is no longer valid (e.g., the agent corresponding to the offer has been removed) and hence needs to be rescinded. Any future calls (ACCEPT / DECLINE) made by the scheduler regarding this offer will be invalid. RESCIND Event (JSON) <event-length>
{ "type"	: "RESCIND", "rescind"	: { "offer_id"	: { "value" : "12214-23523-O235235"} }
}

642.body:
Sent by the master whenever there is a status update that is generated by the executor, agent or master. Status updates should be used by executors to reliably communicate the status of the tasks that they manage. It is crucial that a terminal update (e.g., TASK_FINISHED, TASK_KILLED, TASK_FAILED) is sent by the executor as soon as the task terminates, in order for Mesos to release the resources allocated to the task. It is also the responsibility of the scheduler to explicitly acknowledge the receipt of status updates that are reliably retried. See ACKNOWLEDGE in the Calls section above for the semantics. Note that uuid and data are raw bytes encoded in Base64. UPDATE Event (JSON) <event-length>
{ "type"	: "UPDATE", "update"	: { "status"	: { "task_id"	: { "value" : "12344-my-task"}, "state" : "TASK_RUNNING", "source"	: "SOURCE_EXECUTOR", "uuid" : "adfadfadbhgvjayd23r2uahj", "bytes" : "uhdjfhuagdj63d7hadkf" } }
}

643.body:
Sent by the master whenever there is an update to the state of an operation for which the scheduler requested feedback by setting the operation's id field. It is the responsibility of the scheduler to explicitly acknowledge the receipt of any status updates which have their uuid field set, as this indicates that the update will be retried until acknowledgement is received. This ensures that such updates are delivered reliably. See ACKNOWLEDGE_OPERATION_STATUS in the Calls section above for the relevant acknowledgement semantics. Note that the uuid field contains raw bytes encoded in Base64. UPDATE_OPERATION_STATUS Event (JSON) <event-length>
{ "type"	: "UPDATE_OPERATION_STATUS", "update_operation_status"	: { "status"	: { "operation_id" : { "value" : "operation-1234"}, "state" : "OPERATION_FAILED", "uuid" : "adfadfadbhgvjayd23r2uahj", "agent_id" : { "value" : "12214-23523-S235235"}, "resource_provider_id" : { "value" : "83978-17885-1089645"} } }
}

644.body:
A custom message generated by the executor that is forwarded to the scheduler by the master. This message is not interpreted by Mesos and is only forwarded (without reliability guarantees) to the scheduler. It is up to the executor to retry if the message is dropped for any reason. The data field contains raw bytes encoded as Base64. MESSAGE Event (JSON) <event-length>
{ "type"	: "MESSAGE", "message"	: { "agent_id" : { "value" : "12214-23523-S235235"}, "executor_id"	: { "value" : "12214-23523-my-executor"}, "data" : "adfadf3t2wa3353dfadf" }
}

645.body:
Sent by the master when an agent is removed from the cluster (e.g., failed health checks) or when an executor is terminated. This event coincides with receipt of terminal UPDATE events for any active tasks belonging to the agent or executor and receipt of RESCIND events for any outstanding offers belonging to the agent. Note that there is no guaranteed order between the FAILURE, UPDATE, and RESCIND events. FAILURE Event (JSON) <event-length>
{ "type"	: "FAILURE", "failure"	: { "agent_id" : { "value" : "12214-23523-S235235"}, "executor_id"	: { "value" : "12214-23523-my-executor"}, "status" : 1 }
}

646.body:
Can be sent either: As the first event (in lieu of SUBSCRIBED) when the scheduler's SUBSCRIBE request is invalid (e.g. invalid FrameworkInfo) or unauthorized (e.g., a framework is not authorized to subscribe with some of the given FrameworkInfo.roles). When an asynchronous error event is generated (e.g. the master detects a newer subscription from a failed over instance of the scheduler). It is recommended that the framework abort when it receives an error and retry subscription as necessary. ERROR Event (JSON) <event-length>
{ "type"	: "ERROR", "message"	: "Framework is not authorized"
}

647.body:
This event is periodically sent by the master to inform the scheduler that a connection is alive. This also helps ensure that network intermediates do not close the persistent subscription connection due to lack of data flow. See the next section on how a scheduler can use this event to deal with network partitions. HEARTBEAT Event (JSON) <event-length>
{ "type"	: "HEARTBEAT"
}

655.body:
This is the first step in the communication process between the executor and agent. This is also to be considered as subscription to the "/executor" events stream. To subscribe with the agent, the executor sends an HTTP POST with a SUBSCRIBE message. The HTTP response is a stream in [RecordIO] (scheduler-http-api.md#recordio-response-format) format; the event stream will begin with a SUBSCRIBED event (see details in Events section). Additionally, if the executor is connecting to the agent after a disconnection , it can also send a list of: Unacknowledged Status Updates : The executor is expected to maintain a list of status updates not acknowledged by the agent via the ACKNOWLEDGE events. Unacknowledged Tasks : The executor is expected to maintain a list of tasks that have not been acknowledged by the agent. A task is considered acknowledged if at least one of the status updates for this task is acknowledged by the agent. SUBSCRIBE Request (JSON): POST /api/v1/executor HTTP/1.1 Host: agenthost:5051
Content-Type: application/json
Accept: application/json { "type": "SUBSCRIBE", "executor_id": { "value": "387aa966-8fc5-4428-a794-5a868a60d3eb" }, "framework_id": { "value": "49154f1b-8cf6-4421-bf13-8bd11dccd1f1" }, "subscribe": { "unacknowledged_tasks": [ { "name": "dummy-task", "task_id": { "value": "d40f3f3e-bbe3-44af-a230-4cb1eae72f67" }, "agent_id": { "value": "f1c9cdc5-195e-41a7-a0d7-adaa9af07f81" }, "command": { "value": "ls", "arguments": [ "-l", "\/tmp" ] } } ], "unacknowledged_updates": [ { "framework_id": { "value": "49154f1b-8cf6-4421-bf13-8bd11dccd1f1" }, "status": { "source": "SOURCE_EXECUTOR", "task_id": { "value": "d40f3f3e-bbe3-44af-a230-4cb1eae72f67" }, "state": "TASK_RUNNING", "uuid": "ZDQwZjNmM2UtYmJlMy00NGFmLWEyMzAtNGNiMWVhZTcyZjY3Cg==" } } ] }
} SUBSCRIBE Response Event (JSON):
HTTP/1.1 200 OK Content-Type: application/json
Transfer-Encoding: chunked <event-length>
{ "type": "SUBSCRIBED", "subscribed": { "executor_info": { "executor_id": { "value": "387aa966-8fc5-4428-a794-5a868a60d3eb" }, "command": { "value": "\/path\/to\/executor" }, "framework_id": { "value": "49154f1b-8cf6-4421-bf13-8bd11dccd1f1" } }, "framework_info": { "user": "foo", "name": "my_framework" }, "agent_id": { "value": "f1c9cdc5-195e-41a7-a0d7-adaa9af07f81" }, "agent_info": { "host": "agenthost", "port": 5051 } }
}
<more events> NOTE: Once an executor is launched, the agent waits for a duration of --executor_registration_timeout (configurable at agent startup) for the executor to subscribe. If the executor fails to subscribe within this duration, the agent forcefully destroys the container executor is running in.

656.body:
Sent by the executor to reliably communicate the state of managed tasks. It is crucial that a terminal update (e.g., TASK_FINISHED, TASK_KILLED or TASK_FAILED) is sent to the agent as soon as the task terminates, in order to allow Mesos to release the resources allocated to the task. The scheduler must explicitly respond to this call through an ACKNOWLEDGE message (see ACKNOWLEDGED in the Events section below for the semantics). The executor must maintain a list of unacknowledged updates. If for some reason, the executor is disconnected from the agent, these updates must be sent as part of SUBSCRIBE request in the unacknowledged_updates field. UPDATE Request (JSON): POST /api/v1/executor HTTP/1.1 Host: agenthost:5051
Content-Type: application/json
Accept: application/json { "executor_id": { "value": "387aa966-8fc5-4428-a794-5a868a60d3eb" }, "framework_id": { "value": "9aaa9d0d-e00d-444f-bfbd-23dd197939a0-0000" }, "type": "UPDATE", "update": { "status": { "executor_id": { "value": "387aa966-8fc5-4428-a794-5a868a60d3eb" }, "source": "SOURCE_EXECUTOR", "state": "TASK_RUNNING", "task_id": { "value": "66724cec-2609-4fa0-8d93-c5fb2099d0f8" }, "uuid": "ZDQwZjNmM2UtYmJlMy00NGFmLWEyMzAtNGNiMWVhZTcyZjY3Cg==" } }
} UPDATE Response:
HTTP/1.1 202 Accepted

657.body:
Sent by the executor to send arbitrary binary data to the scheduler. Note that Mesos neither interprets this data nor makes any guarantees about the delivery of this message to the scheduler. The data field is raw bytes encoded in Base64. MESSAGE Request (JSON): POST /api/v1/executor HTTP/1.1 Host: agenthost:5051
Content-Type: application/json
Accept: application/json { "executor_id": { "value": "387aa966-8fc5-4428-a794-5a868a60d3eb" }, "framework_id": { "value": "9aaa9d0d-e00d-444f-bfbd-23dd197939a0-0000" }, "type": "MESSAGE", "message": { "data": "t+Wonz5fRFKMzCnEptlv5A==" }
} MESSAGE Response:
HTTP/1.1 202 Accepted

660.body:
Sent by the agent whenever it needs to assign a new task to the executor. The executor is required to send an UPDATE message back to the agent indicating the success or failure of the task initialization. The executor must maintain a list of unacknowledged tasks (see SUBSCRIBE in Calls section). If for some reason, the executor is disconnected from the agent, these tasks must be sent as part of SUBSCRIBE request in the tasks field. LAUNCH Event (JSON) <event-length>
{ "type": "LAUNCH", "launch": { "framework_info": { "id": { "value": "49154f1b-8cf6-4421-bf13-8bd11dccd1f1" }, "user": "foo", "name": "my_framework" }, "task": { "name": "dummy-task", "task_id": { "value": "d40f3f3e-bbe3-44af-a230-4cb1eae72f67" }, "agent_id": { "value": "f1c9cdc5-195e-41a7-a0d7-adaa9af07f81" }, "command": { "value": "sleep", "arguments": [ "100" ] } } }
}

661.body:
This experimental event was added in 1.1.0. Sent by the agent whenever it needs to assign a new task group to the executor. The executor is required to send UPDATE messages back to the agent indicating the success or failure of each of the tasks in the group. The executor must maintain a list of unacknowledged tasks (see LAUNCH section above). LAUNCH_GROUP Event (JSON) <event-length>
{ "type": "LAUNCH_GROUP", "launch_group": { "task_group" : { "tasks" : [ { "name": "dummy-task", "task_id": { "value": "d40f3f3e-bbe3-44af-a230-4cb1eae72f67" }, "agent_id": { "value": "f1c9cdc5-195e-41a7-a0d7-adaa9af07f81" }, "command": { "value": "sleep", "arguments": [ "100" ] } } ] } }
}

662.body:
The KILL event is sent whenever the scheduler needs to stop execution of a specific task. The executor is required to send a terminal update (e.g., TASK_FINISHED, TASK_KILLED or TASK_FAILED) back to the agent once it has stopped/killed the task. Mesos will mark the task resources as freed once the terminal update is received. LAUNCH Event (JSON) <event-length>
{ "type" : "KILL", "kill" : { "task_id" : {"value" : "d40f3f3e-bbe3-44af-a230-4cb1eae72f67"} }
}

663.body:
Sent by the agent in order to signal the executor that a status update was received as part of the reliable message passing mechanism. Acknowledged updates must not be retried. ACKNOWLEDGED Event (JSON) <event-length>
{ "type" : "ACKNOWLEDGED", "acknowledged" : { "task_id" : {"value" : "d40f3f3e-bbe3-44af-a230-4cb1eae72f67"}, "uuid" : "ZDQwZjNmM2UtYmJlMy00NGFmLWEyMzAtNGNiMWVhZTcyZjY3Cg==" }
}

664.body:
Custom message generated by the scheduler and forwarded all the way to the executor. These messages are delivered "as-is" by Mesos and have no delivery guarantees. It is up to the scheduler to retry if a message is dropped for any reason. The data field contains raw bytes encoded as Base64. MESSAGE Event (JSON) <event-length>
{ "type" : "MESSAGE", "message" : { "data" : "c2FtcGxlIGRhdGE=" }
}

665.body:
Sent by the agent in order to shutdown the executor. Once an executor gets a SHUTDOWN event it is required to kill all its tasks, send TASK_KILLED updates and gracefully exit. If an executor doesn't terminate within a certain period MESOS_EXECUTOR_SHUTDOWN_GRACE_PERIOD (an environment variable set by the agent upon executor startup), the agent will forcefully destroy the container where the executor is running. The agent would then send TASK_LOST updates for any remaining active tasks of this executor. SHUTDOWN Event (JSON) <event-length>
{ "type" : "SHUTDOWN"
}

666.body:
Sent by the agent when an asynchronous error event is generated. It is recommended that the executor abort when it receives an error event and retry subscription. ERROR Event (JSON) <event-length>
{ "type" : "ERROR", "error" : { "message" : "Unrecoverable error" }
}
